import React from 'react';

export const UsersList = ({entries, base_url, onClick, onRemoveClick, editDelete}) => (

    <div className="table_container">
        <div className="Header">
            <div className="h_username">Nombre de usuario</div>
            <div className="h_email">Email</div>
        </div>
        {
            entries.length>0 ?
            (
                entries.map(entry =>
                    <UserDetail editDelete={editDelete} key={entry.id} entry={entry} base_url={base_url} onClick={onClick} onRemoveClick={onRemoveClick}/>
                )
            ) : (
                <div key="no_results" className="no_results"> No se han encontrado resultados </div>
            )
        }
    </div>
);

export const UserDetail = ({user, base_url, onClick}) => (
    <div className="entryDetail" key={entry.id} data-id={entry.id} onClick={onClick}>
        <div className="e_edit"><i className="fas fa-edit"></i></div>
        <div className="e_delete" onClick={() => onRemoveClick(entry.id)}><i className="fas fa-trash-alt"></i></div>

        <div className="user_detail_wrapper">
            <div className="em_title">{user.username}</div>
            <div className="em_author">{user.email}</div>
        </div>
    </div>
)
